class IncotermsCode(IncotermsCodeType):
    """Is a contractual code used to describe the point where delivery occurs
    (goods ownership is transferred) in a contract of sale. It identifies the
    rights and obligations of each partner (supplier, carrier and customer) in the
    transaction and may specify the requirements to assume ownership (i.e. paying
    for the cost of the goods and/or transportation). The United Nations Trade
    Facilitation Information Exchange (UN/TraFIX) has established the following
    codes.

    (INCOTERMS 1990) for use in international trade to Europe, Asia and the Pacific. (See http://www.unece.org/trade/rec/rec05en.htm).
    These terms may also be found in the United States Uniform Commercial Code (UCC). EXAMPLES EXW - Ex Works ... (named place) FCA - Free
    Carrier ... (named place) FAS - Free Along Ship ... (named port of shipment) FOB - Free On Board ... (named port of shipment) CFR -
    Cost and Freight ... (named port of destination) CIF - Cost, Insurance and Freight ... (named port of destination) CPT - Carriage Paid
    To ... (named place of destination) CIP - Carriage and Insurance Paid to ... (named place of destination) DAF - Delivered At Frontier
    ... (named place) DES - Delivered Ex Ship ... (named port of destination) DEQ - Delivered Ex Quay (Duty Paid) ... (named port of
    destination) DDU - Delivered Duty Unpaid ... (named place of destination) DDP - Delivered Duty Paid ... (named place of destination)
    """

    class Meta:
        namespace = "http://www.openapplications.org/oagis/9"

    model_config = ConfigDict(defer_build=True)


