class Process(ProcessType):
    """The Process verb is used to request processing of the associated noun by the
    receiving application or business to party.

    In a typical external exchange scenario a Process BOD is considered
    to be a legally binding message. For example, if a customer sends a
    ProcessPurchaseOrder BOD to a supplier and the supplier acknowlegdes
    with a positive AcknowledgePurchaseOrder, then the customer is
    obligated to fullfil the agreement, unless of course other BODs are
    allowed to cancel or change the original order.
    """

    class Meta:
        namespace = "http://www.openapplications.org/oagis/9"

    model_config = ConfigDict(defer_build=True)


